USE IKEA_SalesToCustomerDB
GO

/* Create Customer Table */
CREATE TABLE Customer (
CustomerID BIGINT PRIMARY KEY NOT NULL,
FirstName varchar(50) NOT NULL,
LastName varchar(50) NOT NULL,
Age Numeric NOT NULL,
Gender VARCHAR(12) NOT NULL,
Email Varchar (50) NOT NULL,
Phone VARCHAR(50) NOT NULL
)

/* Create Sales Table */
CREATE TABLE Sales (
SalesID BIGINT PRIMARY KEY NOT NULL,
CustomerID BIGINT  NOT NULL,
ProductID BIGINT NOT NULL, 
ShipmentID BIGINT  NULL,
VendorID BIGINT  NOT NULL,
Quantity NUMERIC NOT NULL,
SalesPrice NUMERIC NOT NULL,
SalesDate DATE NOT NULL,
)


/* Creat Product Table */
CREATE TABLE Product (
ProductID BIGINT PRIMARY KEY NOT NULL,
ProductName VARCHAR(80) NOT NULL,
ProductCategory VARCHAR(50) NOT NULL,
ProductWeight INTEGER NOT NULL,
DimensionHeight INTEGER NOT NULL,
DimensionWidth INTEGER NOT NULL,
RetailPrice DECIMAL NOT NULL, 
)

/* Create Shipment Table */
CREATE TABLE Shipment (
ShipmentID BIGINT PRIMARY KEY NOT NULL,
CustomerID BIGINT NOT NULL,
ShipmentAddress VARCHAR (100) NOT NULL,
ScheduledShippingDate DATE NULL,
ScheduledShippingTime TIME  NULL,
)

/* Create Vendor Table */
CREATE TABLE Vendor (
VendorID BIGINT PRIMARY KEY NOT NULL,
VendorName VARCHAR (100) NOT NULL,
VendorCountry VARCHAR(20) NOT NULL,
VendorStates VARCHAR(20) NOT NULL,
VendorCity VARCHAR (100) NOT NULL,
VendorAddress VARCHAR (100) NOT NULL,
Phone VARCHAR(50) NOT NULL,
)
/*Create Relationships */
ALTER TABLE Sales ADD CONSTRAINT FK_Sales_Customer
FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID);
ALTER TABLE Sales ADD CONSTRAINT FK_Sales_Product
FOREIGN KEY (ProductID) REFERENCES Product(ProductID);
ALTER TABLE Sales ADD CONSTRAINT FK_Sales_Vendor
FOREIGN KEY (VendorID) REFERENCES Vendor(VendorID);
ALTER TABLE Sales ADD CONSTRAINT FK_Sales_Shipment
FOREIGN KEY (ShipmentID) REFERENCES Shipment(ShipmentID);

ALTER TABLE Shipment ADD CONSTRAINT FK_Shipment_Customer
FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID);
